      "excerpt": "<div class=\"custom-block tip\">\n<p>出错缘由：<br>\n<code>Vue</code> 会尽可能高效地渲染元素，通常会复用已有元素而不是从头开始渲染。<br>\n这样也不总是符合实际需求，所以 Vue 为你提供了一种方式来表达“这两个元素是完全独立的，不要复用它们”。只需添加一个具有唯一值的 <code>key</code> 属性即可。见<a href=\"https://cn.vuejs.org/v2/guide/conditional.html#%E7%94%A8-key-%E7%AE%A1%E7%90%86%E5%8F%AF%E5%A4%8D%E7%94%A8%E7%9A%84%E5%85%83%E7%B4%A0\" target=\"_blank\" rel=\"noopener noreferrer\">详情<OutboundLink/></a></p>\n</div>\n",
