      "excerpt": "<h2 id=\"webpack简介\"><a class=\"header-anchor\" href=\"#webpack简介\">#</a> webpack简介</h2>\n<p>webpack是一个 <strong>模块打包工具</strong>，支持所有的打包语法，比如 <code>ES Module</code>、<code>CommonJS</code>、<code>CMD</code>、<code>AMD</code>。初期的webpack是用来模块打包js的，发展到现在，已经可以打包很多种文件类型，比如 <code>css</code>、<code>img</code> 。</p>\n<p>优化打包速度最有效的方法就是保持 <code>nodejs</code> 和 <code>webpack</code> 为最新版本。</p>\n",
